import React from 'react'
import logo from './image/money.png'
import dollar from './image/dollar.png'

function Project() {
  return (
    <div>
        <h1 className='text-left'>Vids<img src={logo} className='logo' alt='' width={40} height={40}/> pay</h1>
        <h2 className='text-left'><img src={dollar} className='logo' alt='' width={40} height={40}/>Monetization</h2>
    </div>
  )
}

export default Project
